import React, { Component } from 'react';
import 'tachyons';
import BlogCardGrid from './BlogCardGrid';

class BlogsPage extends Component {
  render() {
    return (
      <div>
        <BlogCardGrid />
      </div>
    );
  }
}

export default BlogsPage;
